export enum NSPAppConstants {

  /*
  File upload
  */
  MAXIMUM_MULTI_FILE_SIZE = 500, // in MB
  MAXIMUM_SINGLE_FILE_SIZE = 5, // in MB
  MAXIMUM_FILE_SIZE = 5000000,
  MAXIMUM_REMARKS_CHARACTERS = 2000,
  MAXIMUM_FILES = 5,
  FILE_FORMAT = '.pdf, .gif,.png, .jpg, .csv, .enc, .jar, .txt',

  /* In-line Input Error messages */
  REQUIRED_INPUT_FIELD = 'Required',
  INVALID_NRIC_FORMAT = 'Invalid NRIC format',

  /* Instalment Plan interest rate */
  INSTALMENT_INTEREST_RATE = 5.5,

  CLAIM_NEW_POLICY_CUT_OFF_DATE = '13-09-2022'
  //CLAIM_NEW_POLICY_CUT_OFF_DATE = '13-09-2010'
}

