    PROCESSING_RETURN_FILE = 'Processing Return File',
    ERROR_WRONG_RETURN_FILE = 'Error: Wrong Return File',
    ERROR_CHECK_WITH_PROGRAMMER = 'Error: Check with Programmer',
    ACTIVE = 'Active',
    RESULT_FILE_GENERATION_FAILED = 'Result File Generation Failed',
    PENDING_DOWNLOAD = 'Pending Download',
    PENDING_RETURN = 'Pending Return',
    NEW = 'New',
